  ? 'here should be your production endpoint'
  :  'http://localhost:3000'

class Places extends React.Component{
  state ={
    places:[],
    plans:[]
  }




  render(){
    return(
      <div>
  <h1>plans</h1>
  <Form onSubmit={this.handleSubmit} className="login-form">
        <Form.Item>
            <Input
              prefix={<Icon type="user" style={{ color: 'rgba(0,0,0,.25)' }} />}
              placeholder="Address name"
            />
